pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

// interface IERC20 {
//     function totalSupply() external view returns (uint256);
//     function balanceOf(address account) external view returns (uint256);
//     function transfer(address recipient, uint256 amount) external returns (bool);
//     function allowance(address owner, address spender) external view returns (uint256);
//     function approve(address spender, uint256 amount) external returns (bool);
//     function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
//     event Transfer(address indexed from, address indexed to, uint256 value);
//     event Approval(address indexed owner, address indexed spender, uint256 value);
// }

contract Pool {
    struct Order {
        address tokenIn;
        address tokenOut;
        uint256 amountIn;
        uint256 amountOut;
        uint256 blockNumber; //Block
    }

    address owner;
    address token1;
    address token2;
    uint256 reserve1;
    uint256 reserve2;

    mapping(address => mapping(address => uint256)) balances;
    mapping(address => Order[]) orderBuy;
    mapping(address => uint256) reserve;

    modifier ownerOnly() {
        require(msg.sender == owner, "Owner Only");
        _;
    }

    constructor(address _token1, address _token2) {
        owner = msg.sender;
        token1 = _token1;
        token2 = _token2;
        reserve1 = 0;
        reserve2 = 0;
    }

    // Deposit Token

    function _deposit(uint256 _amount, address _token) internal ownerOnly {
        IERC20 token = IERC20(_token);
        require(
            token.allowance(msg.sender, address(this)) >= _amount,
            "Not authorized"
        );
        bool success = token.transferFrom(msg.sender, address(this), _amount);
        require(success, "Transfer Failed");
        balances[_token][msg.sender] += _amount;
        reserve[_token] += _amount;
    }

    // Withdraw Token

    function _withdraw(uint256 _amount, address _token) internal ownerOnly {
        IERC20 token = IERC20(_token);
        require(
            token.allowance(msg.sender, address(this)) >= _amount,
            "Not authorized amount"
        );
        bool success = token.transferFrom(msg.sender, address(this), _amount);
        require(success, "Transfer Failed");
        require(balances[_token][msg.sender] >= _amount, "Insufficient");

        balances[_token][msg.sender] -= _amount;
        reserve[_token] -= _amount;
    }

    function approveExchangeRate(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    ) public {
        //Dummy go get exchange rate
        uint256 exchangeRate = 10;
        uint256 amountOut = _amountIn * (exchangeRate);

        Order memory newOrder =
            Order(_tokenIn, _tokenOut, _amountIn, amountOut, block.number);
        orderBuy[msg.sender].push(newOrder);
    }
}
